import react from "react";
import LibrarySong from "./LibrarySong";
import Song from "./Song";
/* import Song from "./Song"; */

const Library = ({songs}) => {
    return (
        <div className="Library">
            <h2>Library</h2>
            <div className="Library-songs">
                {songs.map((song) =>(
                    <LibrarySong song={song} />
                ))}
            </div>
        </div>
    )
}

export default Library;
